INSERT INTO `z_blog` VALUES (42, 'menteri-rini-soemarno-resmikan-bts-tenaga-surya-pulau-terdepan-indonesia-timur', '2018-08-16', 'Menteri Rini Soemarno Resmikan BTS Tenaga Surya Pulau Terdepan Indonesia Timur', 'https://www.len.co.id/wp-content/uploads/2018/08/Menteri-Rini-Soemarno-Resmikan-BTS-Tenaga-Surya-Pulau-Terdepan-Indonesia-Timur.jpg', '<p>Rote Ndao, NTT (13/08) &ndash; Menteri BUMN Rini M. Soemarno meresmikan BTS Tenaga Surya (<em>Base Transceiver Station</em>) untuk sistem telekomunikasi Pulau Terdepan Indonesia Timur di Desa Oebela, Pulau Rote, Kabupaten Rote Ndao, Nusa Tenggara Timur pada hari Senin (13/08).</p>\n\n<p>&nbsp;</p>\n\n<p>Kehadiran sistem telekomunikasi BTS yang memanfaatkan PLTS (Pembangkit Listrik Tenaga Surya) di area <em>blankspot</em> tersebut memberikan manfaat untuk menghubungkan masyarakat di daerah 3T (terdepan, terluar dan tertinggal) dengan daerah lainnya. Selain itu juga untuk meningkatkan perekonomian melalui informasi yang lebih terbuka, serta dapat mempercepat aliran informasi jika terjadi kondisi musibah atau bencana.</p>\n\n<p>&nbsp;</p>\n\n<p>&ldquo;Saya ucapkan selamat atas peresmian BTS di Pulau Rote ini. Sebuah kebanggaan bagi kita semua, PT Len sebagai BUMN telah mengambil bagian dalam mendukung peningkatan prasarana telekomunikasi di daerah terdepan. Tentunya saya berharap keberadaan BTS ini mampu membantu masyarakat sekitar dam menjangkau informasi dan mendorong perekonomian,&rdquo; ungkap Menteri Rini.</p>\n\n<p>&nbsp;</p>\n\n<p>BAKTI atau Badan Aksesibilitas Telekomunikasi dan Informasi merupakan satuan kerja Kementerian Komunikasi dan Informatika yang bertugas membangun prasarana telekomunikasi di daerah 3T serta perbatasan. Tujuannya agar daerah tersebut dapat menjangkau akses telekomunikasi dan informasi yang sebelumnya belum terjangkau.</p>\n\n<p>&nbsp;</p>\n\n<p>Bersama BAKTI dalam mendukung program Kementerian Kominfo tersebut, PT Len Industri (Persero) melakukan investasi peralatan PLTS (Pembangkit Listrik Tenaga Surya) dan tower yang kemudian disewakan kepada operator telekomunikasi. PLTS sebagai sumber listrik utama perangkat Telekomunikasi BTS di Desa Oebela memiliki kapasitas 4.680 Watt peak yang terdiri dari 18 unit panel surya 260 Watt peak, serta dilengkapi pula dengan 24 unit baterai di area lahan seluas 324 meter persegi.</p>\n\n<p>&nbsp;</p>\n\n<p>Len telah membangun perangkat BTS Tenaga Surya sebanyak 383 unit melalui anak perusahaannya, PT Surya Energi Indotama (SEI). Sebanyak 317 unit dibangun dalam kurun waktu tahun 2016-2017. Tahun 2018 telah membangun tujuh unit dan sedang melakukan investasi 66 unit lagi.</p>\n\n<p>&nbsp;</p>\n\n<p>Direktur Utama Len, Zakky Gamal Yasin di sela acara mengatakan, &ldquo;Di tengah persaingan bisnis energi yang begitu ketat di Indonesia, khususnya tenaga surya, investasi PLTS bagi Len merupakan terobosan baru melalui dukungan regulasi yang dikeluarkan pemerintah dalam memajukan daerah-daerah 3T.&rdquo;</p>\n\n<p>&nbsp;</p>\n\n<p>PT Len Industri sebagai BUMN di bidang <em>renewable energy</em> memiliki peran sebagai investor <em>power </em>dan tower, manufaktur modul surya, EPC sistem (<em>engineering, procurement and construction</em>) sekaligus menyediakan servis <em>operation </em>dan<em> maintenance</em>.</p>\n\n<p><img alt=\"Menteri Rini Soemarno Resmikan BTS Tenaga Surya Pulau Terdepan Indonesia Timur  Menteri Rini Soemarno Resmikan BTS Tenaga Surya Pulau Terdepan Indonesia Timur menteri rini soemarno resmikan bts tenaga surya pulau terdepan indonesia timur\" src=\"https://www.len.co.id/wp-content/uploads/2018/08/menteri-rini-soemarno-resmikan-bts-tenaga-surya-pulau-terdepan-indonesia-timur.jpg\" style=\"height:350px; width:525px\" /></p>\n\n<p>&nbsp;</p>\n\n<p>Dalam rangka Program BUMN Hadir Untuk Negeri yang terus digalakkan, di acara kunjungan menteri ini ada 9 (sembilan) BUMN bersama-sama menyalurkan dana <em>Corporate Social Responsibility</em>-nya untuk masyarakat daerah perbatasan Indonesia Timur di Pulau Rote, Kabupaten Rote Ndao, NTT. Mereka adalah PT Len Industri, BRI, Mandiri, BNI, PT PLN, PT Pegadaian, PT Pertamina, PT Telkom Indonesia dan PT ASDP Indonesia Ferry.</p>\n\n<p>&nbsp;</p>\n\n<p>Kesembilan BUMN menyerahkan bantuan peralatan seperti PJU tenaga surya, lampu sehen, pompa air tenaga surya, genset, motor gerobak, kompresor Pos Perbatasan, MCK serta renovasi rumah ibadah dengan total nilai bantuan kurang lebih&nbsp; Rp 2,2 Milyar. Bantuan diberikan oleh masing-masing direksi atau pejabat BUMN kepada perwakilan masyarakat Pulau Rote di penghujung acara peresmian.</p>', 'Just Description', '2018-08-16 08:27:23', NULL);
