INSERT INTO `z_blog` VALUES (49, 'len-laksanakan-rkap-rka-pkbl-2013-serta-rkao-anak-perusahaan-unit-kerja-secara-maraton', '2018-08-22', 'Len Laksanakan RKAP & RKA PKBL 2013 serta RKAO Anak Perusahaan & Unit Kerja Secara Maraton', NULL, '<p>Bandung (21/01/13) &ndash; Bertempat di Ruang Pertemuan Gedung Karya Utama, Len melaksanakan RKAO 2013 (Rencana Kerja &amp; Anggaran Organisasi) anak perusahaan serta unit kerja pada tanggal 21-22 Januari secara maraton. Event tahunan ini membahas target-target PT Len Industri di tahun 2013. Lima hari sebelumnya, Rabu tanggal 16 Januari, Len juga telah melaksanakan RKAP dan RKA PKBL 2013 (Rencana Kerja &amp; Anggaran Perusahaan dan Rencana Kerja &amp; Anggaran Program Kemitraan &amp; Bina Lingkungan) bertempat di Gedung Kementerian BUMN Jakarta.</p>', 'Just Description', '2018-08-22 09:26:10', NULL);
