-- ----------------------------
-- View structure for viewsaldo
-- ----------------------------
DROP VIEW IF EXISTS `viewsaldo`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `viewsaldo` AS SELECT SUM(masuk_pokok) AS sdhPokok, SUM(masuk_bunga) AS sdhBunga,(pinjaman.jml_pinjaman-SUM(masuk_pokok)) AS saldoPokok, (pinjaman.jml_bunga - SUM(masuk_bunga)) AS saldoBunga, pinjaman_id FROM `cicilan`,pinjaman WHERE pinjaman_id = pinjaman.id GROUP BY pinjaman_id ;

-- ----------------------------
-- View structure for viewworksheet
-- ----------------------------
DROP VIEW IF EXISTS `viewworksheet`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `viewworksheet` AS select sum(`corcom_db_1`.`cicilan`.`masuk_pokok`) AS `blnPokok`,sum(`corcom_db_1`.`cicilan`.`masuk_bunga`) AS `blnBunga`,group_concat(dayofmonth(`corcom_db_1`.`cicilan`.`tgl_masuk`) separator ',') AS `blnTgl`,`corcom_db_1`.`cicilan`.`pinjaman_id` AS `pinjaman_id`,date_format(`corcom_db_1`.`cicilan`.`tgl_masuk`,'%Y') AS `tahun`,date_format(`corcom_db_1`.`cicilan`.`tgl_masuk`,'%m') AS `bulan` from `corcom_db_1`.`cicilan` group by year(`corcom_db_1`.`cicilan`.`tgl_masuk`),month(`corcom_db_1`.`cicilan`.`tgl_masuk`),`corcom_db_1`.`cicilan`.`pinjaman_id` ;



-- ----------------------------
-- View structure for fixworksheet
-- ----------------------------
DROP VIEW IF EXISTS `fixworksheet`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `fixworksheet` AS SELECT pinjaman_id, tahun,
MAX(CASE WHEN bulan = '01' THEN blnTgl ELSE NULL END) janTgl,
MAX(CASE WHEN bulan = '01' THEN blnPokok ELSE NULL END) janPokok,
MAX(CASE WHEN bulan = '01' THEN blnBunga ELSE NULL END) janBunga,
MAX(CASE WHEN bulan = '02' THEN blnTgl ELSE NULL END) febTgl,
MAX(CASE WHEN bulan = '02' THEN blnPokok ELSE NULL END) febPokok,
MAX(CASE WHEN bulan = '02' THEN blnBunga ELSE NULL END) febBunga,
MAX(CASE WHEN bulan = '03' THEN blnTgl ELSE NULL END) marTgl,
MAX(CASE WHEN bulan = '03' THEN blnPokok ELSE NULL END) marPokok,
MAX(CASE WHEN bulan = '03' THEN blnBunga ELSE NULL END) marBunga,
MAX(CASE WHEN bulan = '04' THEN blnTgl ELSE NULL END) aprTgl,
MAX(CASE WHEN bulan = '04' THEN blnPokok ELSE NULL END) aprPokok,
MAX(CASE WHEN bulan = '04' THEN blnBunga ELSE NULL END) aprBunga,
MAX(CASE WHEN bulan = '05' THEN blnTgl ELSE NULL END) meiTgl,
MAX(CASE WHEN bulan = '05' THEN blnPokok ELSE NULL END) meiPokok,
MAX(CASE WHEN bulan = '05' THEN blnBunga ELSE NULL END) meiBunga,
MAX(CASE WHEN bulan = '06' THEN blnTgl ELSE NULL END) junTgl,
MAX(CASE WHEN bulan = '06' THEN blnPokok ELSE NULL END) junPokok,
MAX(CASE WHEN bulan = '06' THEN blnBunga ELSE NULL END) junBunga,
MAX(CASE WHEN bulan = '07' THEN blnTgl ELSE NULL END) julTgl,
MAX(CASE WHEN bulan = '07' THEN blnPokok ELSE NULL END) julPokok,
MAX(CASE WHEN bulan = '07' THEN blnBunga ELSE NULL END) julBunga,
MAX(CASE WHEN bulan = '08' THEN blnTgl ELSE NULL END) aguTgl,
MAX(CASE WHEN bulan = '08' THEN blnPokok ELSE NULL END) aguPokok,
MAX(CASE WHEN bulan = '08' THEN blnBunga ELSE NULL END) aguBunga,
MAX(CASE WHEN bulan = '09' THEN blnTgl ELSE NULL END) sepTgl,
MAX(CASE WHEN bulan = '09' THEN blnPokok ELSE NULL END) sepPokok,
MAX(CASE WHEN bulan = '09' THEN blnBunga ELSE NULL END) sepBunga,
MAX(CASE WHEN bulan = '10' THEN blnTgl ELSE NULL END) oktTgl,
MAX(CASE WHEN bulan = '10' THEN blnPokok ELSE NULL END) oktPokok,
MAX(CASE WHEN bulan = '10' THEN blnBunga ELSE NULL END) oktBunga,
MAX(CASE WHEN bulan = '11' THEN blnTgl ELSE NULL END) novTgl,
MAX(CASE WHEN bulan = '11' THEN blnPokok ELSE NULL END) novPokok,
MAX(CASE WHEN bulan = '11' THEN blnBunga ELSE NULL END) novBunga,
MAX(CASE WHEN bulan = '12' THEN blnTgl ELSE NULL END) desTgl,
MAX(CASE WHEN bulan = '12' THEN blnPokok ELSE NULL END) desPokok,
MAX(CASE WHEN bulan = '12' THEN blnBunga ELSE NULL END) desBunga
FROM `viewworksheet` GROUP BY pinjaman_id,tahun  
ORDER BY `viewworksheet`.`pinjaman_id` ASC ;

SET FOREIGN_KEY_CHECKS = 1;
